var Fetch=(()=>{function t(t){this.baseURL=t}return t.prototype.get=async function(t,e,s){return"json"==s?this.requestJson(t,"GET",null,e):this.request(t,"GET",null,e)},t.prototype.post=async function(t,e,s={},r){return"json"==r?this.requestJson(t,"POST",e,s):this.request(t,"POST",e,s)},t.prototype.put=async function(t,e,s={},r){return"json"==r?this.requestJson(t,"PUT",e,s):this.request(t,"PUT",e,s)},t.prototype.delete=async function(t,e,s={},r){return"json"==r?this.requestJson(t,"DELETE",null,s):this.request(t,"DELETE",null,s)},t.prototype.requestJson=async function(t,e,s=null,r={}){e={method:e,headers:r,body:s?JSON.stringify(s):null},r=await fetch(this.baseURL+t,e),s=await r.json();if(r.ok)return s;throw new Error(`Error ${r.status}: `+s.message)},t.prototype.request=async function(t,e,s=null,r={}){t=await fetch(this.baseURL+t,{method:e,headers:r,body:s}),e=await t.text();if(t.ok)return e;throw new Error(`Error ${t.status}: `+e.message)},t})();